var hum_target = global.get("humidity_target");
var hum_current = global.get("humidity_current");
var illu_target = global.get("illumination_target");
var illu_current = global.get("illumination_current");
var soil_target = global.get("soil_moisture_target");
var soil_current = global.get("soil_moisture_current");
var temp_target = global.get("temperature_target");
var temp_current = global.get("temperature_current");
msg.payload = 
[{
    "command": "update_text",
    "selector": "#humidity_target",
    "textContent": "target: " + hum_target
},
{
    "command": "update_text",
    "selector": "#humidity_current",
    "textContent": "current: " + hum_current
},
{
    "command": "update_text",
    "selector": "#illumination_target",
    "textContent": "target: " + illu_target
},
{
    "command": "update_text",
    "selector": "#illumination_current",
    "textContent": "current: " + illu_current
},
{
    "command": "update_text",
    "selector": "#soil_moisture_target",
    "textContent": "target: " + soil_target
},
{
    "command": "update_text",
    "selector": "#soil_moisture_current",
    "textContent": "current: " + soil_current
},
{
    "command": "update_text",
    "selector": "#temperature_target",
    "textContent": "target: " + temp_target
},
{
    "command": "update_text",
    "selector": "#temperature_current",
    "textContent": "current: " + temp_current
}];
return msg;

global.set("humidity_current", 10);
global.set("humidity_target", 65);
global.set("soil_moisture_current", 10);
